    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar year. The
    report begins by summarizing Refuge highlights, climatic conditions, land acquisitions,
    planning, and administration during this period. Habitat management is discussed;
    topics include wetlands, croplands, grasslands, grazing, haying, fire management,
    and pest control. Wildlife- including endangered and threatened species, waterfowl,
    marsh and water birds, shorebirds, gulls, terns, and allied species, raptors, game
    mammals, animal control, and disease prevention and control- is also covered. The
    public use section discusses outdoor classrooms and interpretation, hunting, trapping,
    recreational uses, and law enforcement. The equipment and facilities section details
    equipment utilization and replacement, communications systems, and energy conservation.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
